/* harmony default export */ __webpack_exports__["default"] = ("import { Component, Inject } from \"@angular/core\";\nimport { IToastService, ToastService } from \"@nova-ui/bits\";\n\ninterface IExampleTableModel {\n    position: number;\n    name: string;\n    features: any;\n    asset: string;\n    location: string;\n    status: string;\n    outages: number;\n    checks: any;\n}\n\n@Component({\n    selector: \"nui-table-reorder-example\",\n    templateUrl: \"./table-reorder.example.component.html\",\n    styleUrls: [\"./table-reorder.example.component.less\"],\n})\nexport class TableReorderExampleComponent {\n    public displayedColumns = [\"position\", \"name\", \"features\", \"asset\", \"location\", \"status\", \"outages\", \"checks\"];\n    public dataSource = getData();\n\n    constructor(@Inject(ToastService) private toastService: IToastService) { }\n\n    public toastColumns(event: string[]) {\n        this.toastService.info({ message: \"Current order of columns is: \" + event.toString().replace(/,/g, \", \") });\n    }\n}\n\n/** Table data */\nfunction getData(): IExampleTableModel[] {\n    return [\n        {\n            position: 1,\n            name: \"FOCUS-SVR-02258\",\n            features: [\"remote-access-vpn-tunnel\", \"tools\", \"database\", \"orion-ape-backup\", \"patch-manager01\"],\n            asset: \"Workstation\",\n            location: \"Brno\",\n            status: \"status_up\",\n            outages: 55,\n            checks: [{\n                icon: \"status_up\",\n                num: 25,\n            }],\n        },\n        {\n            position: 2,\n            name: \"Man-LT-JYJ4AD5\",\n            features: [\"remote-access-vpn-tunnel\", \"tools\", \"database\", \"orion-ape-backup\", \"patch-manager01\"],\n            asset: \"Workstation\",\n            location: \"Brno\",\n            status: \"status_up\",\n            outages: 6,\n            checks: [{\n                icon: \"status_critical\",\n                num: 25,\n            }],\n        },\n        {\n            position: 3,\n            name: \"FOCUS-SVR-02258\",\n            features: [\"remote-access-vpn-tunnel\", \"tools\", \"database\", \"orion-ape-backup\", \"patch-manager01\"],\n            asset: \"Workstation\",\n            location: \"Brno\",\n            status: \"status_up\",\n            outages: 7,\n            checks: [{\n                icon: \"status_down\",\n                num: 25,\n            }],\n        },\n        {\n            position: 4,\n            name: \"Man-LT-JYJ4AD5\",\n            features: [\"remote-access-vpn-tunnel\", \"tools\", \"database\", \"orion-ape-backup\", \"patch-manager01\"],\n            asset: \"Workstation\",\n            location: \"Brno\",\n            status: \"status_up\",\n            outages: 27,\n            checks: [{\n                icon: \"status_up\",\n                num: 25,\n            }],\n        },\n        {\n            position: 5,\n            name: \"Man-LT-JYJ4AD5\",\n            features: [\"remote-access-vpn-tunnel\", \"tools\", \"database\", \"orion-ape-backup\", \"patch-manager01\"],\n            asset: \"Workstation\",\n            location: \"Brno\",\n            status: \"status_up\",\n            outages: 18,\n            checks: [{\n                icon: \"status_up\",\n                num: 25,\n            }],\n        },\n   ];\n}\n");

