/* harmony default export */ __webpack_exports__["default"] = ("<style>\n    .markers ul li {\n        list-style-type: circle;\n        text-indent: 30px;\n    }\n</style>\n\n<p>\n    A Data Table is used for presenting data in a logical table-layout structure, and <code>&lt;nui-table&gt;</code> is the Nova\n    component that provides this functionality.\n</p>\n\n<h2>Required Modules</h2>\n<ul>\n    <li>\n        <code>NuiTableModule</code>\n    </li>\n</ul>\n\n<h2>Basic Usage</h2>\n\n<ul>\n    <li>1. Define columns to display\n        <p>\n            A column definition is specified via an <code>ng-container</code> with the <code>nuiColumnDef</code> attribute,\n            giving each column a name. Each column definition can contain a header-cell template with an <code>*nuiHeaderCellDef</code>\n            attribute, a data-cell template with an <code>*nuiCellDef</code> attribute, and a footer-cell template with an\n            <code>*nuiFooterCellDef</code> attribute.\n        </p>\n    </li>\n    <li>2. Define the table's header-row and data-row\n        <p>\n            This can be done via the <code>*nuiHeaderRowDef</code> and <code>*nuiRowDef</code> attributes respectively.\n        </p>\n    </li>\n    <li>3. Initialize the <code>*nuiHeaderRowRef</code> attribute with the list of column names\n        <p>\n            This one should be in sync with the column templates (i.e. four <code>nuiColumnDef</code> directives\n            for four items in the columns array.\n        </p>\n    </li>\n    <li>4. Assign some data to the <code>dataSource</code> input\n        <p>\n            When this one changes, the table will re-render. Note: Table re-rendering will only occur when the actual reference\n            of <code>dataSource</code> changes.\n        </p>\n    </li>\n</ul>\n<p>\n    To make a table scroll horizontally, wrap it in a container with the class <code>nui-table__container</code> or\n    add this class to your existing wrapper. Without this class, a table that exceeds the width of its container\n    will overlap the right edge of the container.\n</p>\n<nui-example-wrapper filenamePrefix=\"table-basic\" exampleTitle=\"Basic Usage\">\n    <nui-table-basic-example></nui-table-basic-example>\n</nui-example-wrapper>\n\n<h2>Pinned Header</h2>\n<p>\n    To make the header sticky, set the <code>sticky</code> input to true on the <code>*nuiHeaderRowDef</code> directive.\n</p>\n<nui-example-wrapper filenamePrefix=\"table-pinned-header\" exampleTitle=\"Pinned header\">\n    <nui-table-pinned-header-example></nui-table-pinned-header-example>\n</nui-example-wrapper>\n\n<h2>Cell Content Alignment</h2>\n<p>\n    By default, cell content in the form of text is aligned to the left, and numbers are aligned to the right\n    (alignment for a cell is determined by its corresponding datasource item). All alignments can be set via the\n    <code>alignment</code> input of an <code>nui-cell</code> or <code>nui-header-cell</code> directive.\n    Valid options are: <b>left</b>, <b>right</b>, or <b>center</b>.\n</p>\n<p>\n    If you want custom positioning and alignment inside table cells, just\n    wrap everything inside your cell in the container and apply styles just as you need them:\n</p>\n<nui-example-code language=\"html\">\n    {{alignmentCode}}\n</nui-example-code>\n<p>\n    Or, you can apply some styling to the whole <code>td</code> by putting your class there:\n    <code>&lt;td nui-cell *nuiCellDef=\"let element\" class=\"custom-class\"&gt;&lt;/td&gt;</code>\n</p>\n<p> For example, column \"Location\" is vertically aligned to the top, and column \"Outages\" is vertically aligned to the bottom.</p>\n<p>\n    <b>Note:</b> Input <code>type=\"icon\"</code> on the <code>nuiColumnDef</code> directive will set width of that column's\n    cells to 40px and center the cell content both vertically and horizontally.\n</p>\n<nui-example-wrapper filenamePrefix=\"table-cell-content-align\" exampleTitle=\"Column Alignment\">\n    <nui-table-cell-content-align-example></nui-table-cell-content-align-example>\n</nui-example-wrapper>\n\n<h2>Column Width and Tooltips</h2>\n<p>\n    To change width of a column, use Angular binding syntax to set the pixel value of <code>[style.width.px]</code> on the\n    <code>&lt;th&gt;</code> element of the column.\n</p>\n<p>\n    To add a tooltip to a cell, set the <code>[tooltipText]</code> input on the <code>nuiHeaderCellDef</code> or\n    <code>nuiCellDef</code> directive.\n</p>\n<h3>Default widths:</h3>\n<ul>\n    <li><b>Table</b> <code>width</code> is <b>100%</b>.</li>\n    <li><b>Column</b> <code>min-width</code> is <b>46px</b>.</li>\n</ul>\n<nui-example-wrapper filenamePrefix=\"table-cell-width-set\" exampleTitle=\"Column Width and Tooltips\">\n    <nui-table-cell-width-set></nui-table-cell-width-set>\n</nui-example-wrapper>\n\n<h2>Row Density</h2>\n<p>\n    Row height can be specified via the <code>density</code> input of <code>nui-row</code>. Valid options are: <b>default</b> - 40px,\n    <b>compact</b> - 30px, or <b>tiny</b> - 24px. <code>density = \"tiny\"</code> is used in the example below. The same for header height.\n</p>\n<nui-example-wrapper filenamePrefix=\"table-row-height-set\" exampleTitle=\"Row Density\">\n    <nui-table-row-height-set></nui-table-row-height-set>\n</nui-example-wrapper>\n\n<h2>Column Reordering</h2>\n<p>\n    To make a table reorderable, <code>[reorderable]=\"true\"</code> should be specified on the <code>&lt;nui-table&gt;</code> element. Bind to the\n    reordering event using the <code>(columnsOrderChange)</code> output.\n</p>\n<nui-example-wrapper filenamePrefix=\"table-reorder\" exampleTitle=\"Column reordering\">\n    <nui-table-reorder-example></nui-table-reorder-example>\n</nui-example-wrapper>\n\n<h2>Custom Actions</h2>\n<p>\n    Table supports custom user actions. To add or remove table columns, update the list of column names you are passing to the <code>nuiHeaderRowDef</code>\n    and <code>nuiRowDef</code> directives. The template for added columns should be provided, and, if a column is removed,\n    the corresponding column template should also be removed.\n</p>\n<p>\n    To add or remove table rows you need to:\n</p>\n<ol>\n    <li>\n        Add <code>@ViewChild</code> in your component.\n    </li>\n    <li>\n        Modify your <code>dataSource.</code>\n    </li>\n    <li>\n        After modifying your data (adding or removing rows) you will need to call <code>renderRows</code> method on your\n        table using <code>@ViewChild</code> variable.\n    </li>\n</ol>\n<p>\n    <b>Note 1:</b> If you want to use <code>nui-menu</code> or other components with dropdowns you will need to add class\n    to <code>td</code> in your template where you will need to set <code>overflow:visible</code>.\n</p>\n<p>\n    <b>Note 2:</b> Class <code>nui-edge-definer</code> is added to table container in this example not to make menu open\n    down in the last row and cause scroll because of <code>overflow:auto</code>.\n</p>\n<nui-example-wrapper filenamePrefix=\"table-columns-add-remove\" exampleTitle=\"Custom actions\">\n    <nui-table-columns-add-remove-example></nui-table-columns-add-remove-example>\n</nui-example-wrapper>\n\n<h2>Column Resize</h2>\n<p>\n    To enable the resizing of a table you need to set <code>[resizable]=\"true\"</code>. When a table is resizable, it's layout\n    is set to <code>table-layout: fixed</code>; therefore, column widths will not be recalculated automatically as they are with\n    the default table-layout. You can provide the desired width of a column in <code>px</code> on the <code>columnDef</code> directive.\n    The rest of the table width will be distributed among the other columns equally.\n</p>\n<nui-example-wrapper filenamePrefix=\"table-resize\" exampleTitle=\"Column resize\">\n    <nui-table-resize-example></nui-table-resize-example>\n</nui-example-wrapper>\n\n<h2>Using trackBy</h2>\n<p>\n    To improve performance, you can let Angular know which row elements in the table can be reused during\n    a change detection cycle by binding a trackBy handler to <code>nui-table</code>'s\n    <code><a href=\"https://material.angular.io/cdk/table/overview#connecting-the-table-to-a-data-source\" target=\"_blank\">trackBy</a></code>\n    property inherited from\n    <code><a href=\"https://material.angular.io/cdk/table/overview\" target=\"_blank\">CdkTable</a></code>.\n    The trackBy handler should return a value that uniquely identifies each item in the table.\n</p>\n<p>\n    Besides performance, another benefit of using trackBy is that the table can keep track of selections\n    based on the identifier returned by the trackBy handler. This is necessary if table items are\n    transmitted across the wire during user interaction. See <strong>Enabling Row Selection</strong>\n    below for usage.\n</p>\n\n<h2>Enabling Row Selection</h2>\n<p>\n    To be able to select rows, do the following:\n</p>\n<nui-table-row-selection-instructions></nui-table-row-selection-instructions>\n<p>\n    <b>Note 1:</b>To preselect rows in table and programmatically change selection you can use\n    <code>[selection]</code> input which has\n    <code><a href=\"../interfaces/ISelection.html\" target=\"_blank\">ISelection</a></code> type.\n</p>\n<p>\n    <b>Note 2:</b> If you need to use <code>paginator</code> with row selection, you need to pass count\n    of all items on all pages into <code>totalItems</code> input.\n</p>\n<nui-message [allowDismiss]=false type=\"warning\">\n    <p>\n        <strong>Important:</strong> When working with data that's coming across the wire, it's necessary\n        to bind a trackBy handler as mentioned above. This will allow selection tracking to be based on\n        the identifier returned by the trackBy handler. If a trackBy is not provided, comparisons to\n        determine whether items are selected will be based on object reference which of course\n        won't work with items coming from a backend.\n    </p>\n    Take a look at the source of the following example to see how.\n</nui-message>\n<nui-example-wrapper filenamePrefix=\"table-select\" exampleTitle=\"Enabling Row Selection\">\n    <nui-table-select></nui-table-select>\n</nui-example-wrapper>\n<h3>Clickable Table Row</h3>\n<p>\n    This option allows for making the whole row clickable for selecting or deselecting it instead of\n\thaving the checkbox as the only selectable area. It should be combined with the\n\t<code>selectable = true</code> input of the corresponding <code>TableComponent</code>. When a table\n\thas no selectable rows configured, it's obviously not possible to enable row selection/deselection\n\tby clicking on any area of the row.\n</p>\n<p>\n    In a very basic configuration, when the table has <code>selectable = true</code> configured, adding\n\t<code>clickableRow = true</code> input to the <code>TR</code> element introduces a behavior in which\n\tany click inside the row selects or deselects it.\n</p>\n<p>\n    Sometimes it isn't desirable to select/deselect a row when certain elements within the row are\n\tclicked as they serve other purposes - e.g. when a button is located inside a row, a user would\n\texpect some action to be triggered on the button click, rather than selection of the row. So it's\n\tpossible to configure the row click behavior to ignore clicks on some predefined elements. Such\n\telements can be configured by providing their CSS selectors in the <code>ignoredSelectors</code>\n\tproperty of the <code>clickableRowConfig</code> input. The default value for this property is\n\t<code>[\"button\", \"input[type='button']\", \"a[href]\"]</code>. It's also possible to explicitly\n\tconfigure elements to trigger row selection/deselection on click. This can be done by providing\n\ttheir CSS selectors in the <code>clickableSelectors</code> property of the\n\t<code>clickableRowConfig</code> input. It's default value is <code>[\"nui-row\", \"tr[nui-row]\"]</code>.\n</p>\n<nui-example-wrapper filenamePrefix=\"table-row-clickable\" exampleTitle=\"Clickable Table Row\">\n    <nui-table-row-clickable></nui-table-row-clickable>\n</nui-example-wrapper>\n\n<h2>Infinite Scrolling Without Custom Strategy</h2>\n<nui-message [allowDismiss]=false type=\"warning\">\n    Please consult your UX team before using the example below.\n</nui-message>\n<p>\n    In case one doesn't want to create a custom virtual scroll strategy to implement scrolling for the <code>nui-table</code> there is a solution\n    that does not use viewport indexes, and involves background data fetching. User is required to set a <code>step</code> and <code>itemsToLoad</code>\n    fields to configure how many items they want to load per user action, and the step size. <br><br>\n\n    For example, if user wants 500 items loaded per user action, it may be heavy to load so many items at once. Setting the <code>step</code> field\n    sets the amount of data loaded on the background to smoothen user experience, and let user scroll through the loaded chunks instead of waiting for\n    the entire dataset to get loaded. This means if we want 500 items loaded and set the step to 100, there will be total 5 API calls to fetch 100 items each.\n    This allows user to get chunks of data on the background and get them loaded in the table while he's able to scroll throught the results.\n</p>\n\nConsider the following in the example:\n<ol>\n    <li>\n        <code>step</code> - sets the step (how many items are loaded per fetch on the background). Pay attention, there is logic that handles the leftover, which\n        means if there are 500 items to load and we set the <code>step</code> to 200, there will be total 3 API calls fetching 200, 200, and the leftover of 100 items.\n    </li>\n    <li>\n        <code>itemsToLoad</code> - total amount of data to load per user action.\n    </li>\n    <li>\n        Optional <code>sticky footer</code>. When inside the sdk virtual scrolll viewport, the footer will scroll with the rest of the items. When sticky, it stays\n        visible all the time.\n    </li>\n    <li>\n        <code>Load next X items</code> button in footer. This allows to fetch an additional chunk of data on demand, which may be more desirable in some cases.\n    </li>\n</ol>\n\n<nui-example-wrapper filenamePrefix=\"table-virtual-scroll-steps-and-button\" exampleTitle=\"Scrolling with Step Fetching and Optional Data Load\">\n    <nui-table-virtual-scroll-steps-and-button-example></nui-table-virtual-scroll-steps-and-button-example>\n</nui-example-wrapper>\n\n<h3>Virtual Scroll with Sticky Header</h3>\n<p>\n    To be able to use Nova Table with CDK Virtual Scroll we provide a special directive\n    <code>tableStickyHeader</code> which will detach table head from scrollable viewport and will simulate the sticky/fixed position.\n</p>\n<nui-message [allowDismiss]=false type=\"warning\">\n    Bind <strong>only visible rows</strong> to the table's <strong>dataSource</strong> and use <strong>cdkVirtualFor</strong> to render the rows.\n</nui-message>\n<nui-message [allowDismiss]=\"false\" type=\"info\">\n    <code>tableStickyHeader</code> directive supports runtime state switch by just binding a boolean value to it <code>[tableStickyHeader]=\"false\"</code>\n    or taking the <code>TableStickyHeaderDirective</code> reference via <code>ViewChild</code> decorator and updating the <code>tableStickyHeader</code> property.\n</nui-message>\n<nui-example-wrapper filenamePrefix=\"table-virtual-scroll-sticky-header\" exampleTitle=\"Virtual Scroll with Sticky Header\">\n    <nui-table-virtual-scroll-sticky-header-example></nui-table-virtual-scroll-sticky-header-example>\n</nui-example-wrapper>\n\n<h3>Virtual Scroll with Sticky Header and Row Selection</h3>\n<p>\n    To implement selection on a table with virtual scroll you can start with the <strong>Virtual Scroll with Sticky Header</strong> example and then follow the <strong>Enabling Row Selection</strong> steps:\n</p>\n<nui-table-row-selection-instructions></nui-table-row-selection-instructions>\n<nui-example-wrapper filenamePrefix=\"table-virtual-scroll-select-sticky-header\" exampleTitle=\"Virtual Scroll with Sticky Header and Select\">\n    <nui-table-virtual-scroll-select-sticky-header-example></nui-table-virtual-scroll-select-sticky-header-example>\n</nui-example-wrapper>\n\n<nui-message [allowDismiss]=\"false\" type=\"info\">\n    Pagination, Virtual Scroll aren't natively part of the <code>nui-table</code> component but the <a href=\"../additional-documentation/schematics/table.html\" target=\"_parent\">Table Schematic documentation</a> provides examples on how to use them;\n    For sorting and search the same schematic can be used to generate automatically the code.\n</nui-message>\n");

