/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"nui-edge-definer nui-table__container\" id=\"nui-demo-table-columns-add-remove\">\n    <section class=\"demo-options-section mb-3\">\n        <button type=\"button\"\n                id=\"nui-demo-table-columns-add-remove-edit-btn\"\n                nui-button\n                icon=\"edit\"\n                (click)=\"open(content)\"\n                i18n>\n            Edit columns\n        </button>\n\n        <ng-template #content let-close=\"close\" let-dismiss=\"dismiss\">\n            <nui-dialog-header i18n-title title=\"Edit columns\" (closed)=\"close()\"></nui-dialog-header>\n            <form [formGroup]=\"myForm\">\n                <div class=\"form-group\">\n                    <div class=\"dialog-body\">\n                        <nui-message [allowDismiss]=\"true\"\n                                     type=\"critical\"\n                                     *ngIf=\"!myForm.controls['checkboxGroup'].valid && myForm.controls['checkboxGroup'].touched\">\n                            <b i18n>Select minimum 3 checkboxes!</b>\n                        </nui-message>\n\n                        <h5 i18n>Available columns</h5>\n                        <nui-checkbox-group id=\"nui-demo-table-add-remove-checkboxes\"\n                                            [values]=\"displayedColumnsCopy\"\n                                            (valuesChange)=\"columnsChanged($event)\"\n                                            formControlName=\"checkboxGroup\"\n                                            required>\n                            <nui-checkbox *ngFor=\"let availableColumn of availableColumns\"\n                                          [value]=\"availableColumn\"\n                                          class=\"text-capitalize\"\n                                          [checked]=\"isChecked(availableColumn)\">\n                                {{availableColumn}}\n                            </nui-checkbox>\n                        </nui-checkbox-group>\n\n                        <nui-divider></nui-divider>\n\n                        <h5 i18n>Create new column</h5>\n                        <div class=\"d-flex flex-row\">\n                            <div class=\"col\">\n                                <nui-textbox\n                                    id=\"nui-demo-table-add-remove-new-column-textbox\"\n                                    [value]=\"newColumn\"\n                                    (textChange)=\"updateNewColumnValue($event)\"\n                                    i18n-placeholder\n                                    placeholder=\"Enter new column title\">\n                                </nui-textbox>\n                            </div>\n                            <div class=\"col col-auto\">\n                                <button nui-button\n                                        type=\"button\"\n                                        displayStyle=\"default\"\n                                        id=\"nui-demo-table-add-remove-new-column-btn\"\n                                        class=\"ml-3\"\n                                        (click)=\"addNewColumn()\"\n                                        i18n>\n                                    Add new column\n                                </button>\n                            </div>\n                        </div>\n                    </div>\n                    <nui-dialog-footer>\n                        <button nui-button\n                                type=\"button\"\n                                (click)=\"close('Cancel')\"\n                                i18n>\n                            Cancel\n                        </button>\n                        <button nui-button\n                                type=\"button\"\n                                id=\"nui-demo-table-columns-add-remove-submit-btn\"\n                                displayStyle=\"primary\"\n                                (click)=\"updateColumns(); close('Action')\"\n                                [disabled]=\"myForm.controls['checkboxGroup'].invalid\"\n                                i18n>\n                            Update columns\n                        </button>\n                    </nui-dialog-footer>\n                </div>\n            </form>\n        </ng-template>\n    </section>\n    <table nui-table [dataSource]=\"dataSource\">\n        <ng-container *ngFor=\"let column of displayedColumns\" nuiColumnDef=\"{{column}}\">\n            <th nui-header-cell *nuiHeaderCellDef class=\"text-capitalize\"> {{column}}</th>\n            <td nui-cell *nuiCellDef=\"let element\"\n                [class.overflow-visible]=\"columnIsActions(column)\">\n                <span *ngIf=\"!columnIsActions(column)\">{{element[column]}}</span>\n                <span *ngIf=\"columnIsActions(column)\">\n                    <nui-menu icon=\"menu\">\n                        <nui-menu-action (actionDone)=\"prependRow()\" i18n>Add new row to the beginning</nui-menu-action>\n                        <nui-menu-action (actionDone)=\"appendRow()\" i18n>Add new row to the end</nui-menu-action>\n                        <nui-menu-action (actionDone)=\"deleteRow(element)\" i18n>Delete row</nui-menu-action>\n                    </nui-menu>\n                </span>\n            </td>\n        </ng-container>\n        <tr nui-header-row *nuiHeaderRowDef=\"displayedColumns\"></tr>\n        <tr nui-row *nuiRowDef=\"let row; columns: displayedColumns;\"></tr>\n    </table>\n</div>\n");

